import Layouts from '../components/layouts';
import Todos from '../components/todos';

class index extends React.Component {
  render() {
      state = {
         todos: [
                    {
                        id: 1,
                        title: 'learn enye', 
                        completed: false
                    },
                    {
                        id: 2,
                        title: 'finish sweeping',
                        completed: false
                    },
                    {
                        id: 3,
                        title: 'go to store',
                        completed: false
                    }
          ]
      }
    return (
      <div>
          <Layouts>
              <Todos todos={this.state.todos}/>
          </Layouts>
      </div>
      
    );
  }
}

export default index;
